import React from 'react'
import Particles from 'react-particles-js'

export default function Home(props) {
    return (
        <div className="home" id="home">
            <Particles className="resize-fix"
            params={{
                "particles": {
                    "number": {
                        "value": 100
                    },
                    "size": {
                        "value": 4,
                        "random": true
                    },
                    "color": {
                        "value":"#ffffff"
                    },
                    "line_linked": {
                        "enable": false,
                        "opacity": 1,
                        "color": "#ffffff",
                        "width": 1
                    },
                    "move": {
                        "enable": true,
                        "straight": false,
                    },
                },
                "interactivity": {
                    "events": {
                        "onhover": {
                            "enable": true,
                            "mode": "repulse"
                        },
                    },
                    "resize": true
                }
            }} />
        </div>
    )
}
